interface CountdownProps {
  icon: string;
  count?: string | number;
}

export function Countdown({ icon, count }: CountdownProps) {
  return (
    <div>
      <img src={icon} alt="icono countdown" />
      <span>{count || "696969"}</span>
    </div>
  );
}

export default Countdown;
